import '../Styles/Home.css';
import '../Styles/Menu.css';
import React from 'react';
import {BrowserRouter as Router, Link, Route} from 'react-router-dom';
import Bio from './Bio.js';
import Home from './Home.js';

function Menu() {
    return (

        <Router>
            <div className="menu">
                <div className="menu-left">
                    <img className='logoim1' src="/images/logoimage.png" alt="Image 1"/>
                    <img className='logoim2' src="/images/atelierbeevy.png" alt="Image 2"/>
                </div>
                <div className="menu-right">
                    <Link to="/bio">Bio</Link>
                    <Link to="#">Ateliers d'écriture</Link>
                    <Link to="#">Médias</Link>
                    <Link to="#">Tarifs</Link>
                    <Link to="#">Contact</Link>
                </div>
            </div>
            <Route path="/" exact component={Home}/>
            <Route path="/bio" component={Bio}/> {/* Ajoutez des routes similaires pour les autres pages */}
        </Router>

    );
}

export default Menu;
